import styled from "styled-components";


const Container = styled.div`
    font-family: WantedSans-Regular;
    margin-top : 40px;
    background-color :red;
    font-size : 16px;
`


function About() {

    return (
        <Container>
            <p >Hello, I'm Kim Je-joo (Kim Gun-hwi), a developer who enjoys correcting the code.

                I am mainly in charge of server development, infrastructure construction, and operation and distribution.

                I'm developing today, enjoying the work of securing better readability and productivity in the process of correcting the code I wrote!

                If you are curious about me, please feel free to contact me!
            </p>
        </Container>
    )
}

export default About
